import {Dialog,Box,TextField,Typography,Button,styled} from '@mui/material';

const Component =styled(Box)`
height:70vh;
width:90vh;
`;
const Image = styled(Box)`
background:#2874f0 url(https://static-assets-web.flixcart.com/www/linchpin/fk-cp-zion/img/login_img_c4a81e.png) no-repeat;
height:100%;
width:40%;

`
const LoginDialog =({open, setOpen}) => {
  const handleClose =() =>{
    setOpen(false);
  }

    return (
        <Dialog open={open} onClose ={handleClose} >
          <Component>
            <Box style ={{display:'flex',height:'100%'}}>
            <Image>

            </Image>
            <Box>
              <TextField variant ="standard" label ="Enter Email/Mobile number"/>
              <TextField variant ="standard" label ="Enter Password"/>
              <TextField>By continuing, you agree to Flipkart's Terms of use and Privacy Policy.</TextField>
              <Button>Login</Button>
              <Typography>OR</Typography>
              <Button>Request OTP</Button>
              <Typography>New to Flipkart an acoount</Typography>
            </Box>
            </Box>
          </Component>
        </Dialog>
    )
}
export default LoginDialog;
